import React from "react";
import "./PatientRecords.css";
import { motion } from "framer-motion";
import { useLocation} from "react-router-dom";
import Navbar from './Navbar';
import { useState,useEffect } from "react";
import api from "../../api";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  ResponsiveContainer,
  CartesianGrid
} from "recharts";

const generateSampleECG = () => {
  const data = [];
  for (let i = 0; i <= 30; i++) {
    const y =
      Math.sin(i * 0.5) * 30 +
      (Math.random() * 10 - 5) +
      (i % 10 === 0 ? Math.random() * 50 + 20 : 0);
    data.push({ x: i, y });
  }
  return data;
};

const PatientRecord = () => {
  const location = useLocation();

  const patientData = location.state || {};
  const [medical_records , setMedicalRecords] = useState({});
  const [error, setError] = useState("");

  useEffect(()=>{
    const fetchRecords = async ()=>{
      const res = await api.get(`iot-data/patient/${patientData.id}/recent`);
      console.log(res.data)
      setMedicalRecords(res.data)
    }
    if(patientData.id){
      fetchRecords();
    }

  },[patientData.id])

  console.log(medical_records)

  return (
    <div>
      <Navbar />
      <div className="patient-records-container">

        {/* ðŸ‘¤ Patient Info outside the card */}
        <div className="patient-details" style={{ marginBottom: "1.5rem" }}>
          <h2>{patientData.name}</h2>
          <p><strong>Gender:</strong> {patientData.gender}</p>
          <p><strong>Contact:</strong> {patientData.contact}</p>
        </div>

        {/* ðŸ“‹ Medical Records and Graph inside the card */}
        <motion.div
          className="record-card"
          initial={{ opacity: 0, y: 50 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.5 }}
        >
          <div className="record-info">
            <p><strong>ECG:</strong> {medical_records.field5}</p>
            <p><strong>Heart Rate:</strong> {medical_records.heart_rate} bpm</p>
            <p><strong>Body Temp:</strong> {medical_records.body_temperature} Â°F</p>
            <p><strong>Room Temp:</strong> {medical_records.room_temperature} Â°F</p>
            <p><strong>Oxygen Level:</strong> {medical_records.O2_level}%</p>
          </div>

          <div className="ecg-graph">
            <h4>ECG Graph</h4>
            <ResponsiveContainer width="100%" height={150}>
              <LineChart data={generateSampleECG()}>
                <CartesianGrid strokeDasharray="3 3" />
                <XAxis dataKey="x" hide />
                <YAxis hide domain={['auto', 'auto']} />
                <Tooltip />
                <Line
                  type="monotone"
                  dataKey="y"
                  stroke="#8884d8"
                  strokeWidth={2}
                  dot={false}
                />
              </LineChart>
            </ResponsiveContainer>
          </div>
        </motion.div>
      </div>
    </div>
  );
};

export default PatientRecord;
